(function(){var n=`
        <div class="row form-horizontal" id="add-mark">
            <div class="form-group">
                <label class="control-label col-xs-3">
                    <span class="require">名称：</span>
                </label>
                <div class="col-xs-8">
                    <input class="form-control" autocomplete="off" id="markName" />
                </div>
            </div>
        </div>
    `;new Vue({el:"#app",data:{flavor:null,orderMark:null,refundFoodReason:null,payRemark:null},methods:{add:function(t,i){$.view({title:"新增标签",footDisplay:"block",template:n,submit:function(){var n=$("#markName").val(),r;if(!$.trim(n)){$.alert("请输入名称");return}return r={name:n,category:t},axios.post("/tang/addMark",r).then(function(n){if(!n.data.success){$.alert(n.data.msg);return}$.alert(n.data.msg,"success");i.push(n.data.data)}).catch(function(n){$.alert(n)}),!0}})},remove:function(n,t){$.primary(`确定删除标签[${n.name}]吗？`,function(){return axios.delete("/tang/removeMark/"+n.id).then(function(i){if(!i.data.success){$.alert(i.data.msg);return}$.alert(i.data.msg,"success");t.remove(n)}).catch(function(n){$.alert(n)}),!0})}},created:function(){var n=this;axios.get("/tang/getMarks").then(function(t){n.flavor=t.data.flavor;n.orderMark=t.data.orderMark;n.refundFoodReason=t.data.refundFoodReason;n.payRemark=t.data.payRemark})}})})();